(754, 49, 'section4_text1', 'This easy-to-use tool helps estate planners empower their clients with meticulous financial insight for the rest of their lives and beyond.'),
(755, 49, '_section4_text1', 'field_5cb08f6ead98d'),
(756, 49, 'section4_text2', '<p>By revealing the financial implications of a variety of life choices and hypotheticals, LifeLens removes uncertainty for a college grad’s transition into the workforce.</p>'),
(757, 49, '_section4_text2', 'field_5cb08f84ad98e'),
(758, 49, 'section4_text3', 'Equip yourself with a clear understanding of the financial pros and cons of homeownership and take the anxiety out of the homebuying process.'),
(759, 49, '_section4_text3', 'field_5cb08f96ad98f'),
(760, 49, 'section4_text4', 'Providing the singles or widows in your life with a LifeLens subscription gives them the gift of financial certainty and peace of mind.'),
(761, 49, '_section4_text4', 'field_5cb08fa2ad990'),
(762, 49, 'section4_text5', 'Ever-changing family finances can feel like a rollercoaster. LifeLens helps provide stability and confidence, no matter how your family grows over the years.'),
(763, 49, '_section4_text5', 'field_5cb08fb1ad991'),
(764, 49, 'section4_text6', 'Newlyweds can start their marriage off on the right foot—and the same page—by sharing a complete understanding of their financial outlook.'),
(765, 49, '_section4_text6', 'field_5cb08fc7ad992'),
(766, 49, 'section4_text7', 'The advanced modeling and planning capabilities offered by LifeLens helps you live a life of comfortable, fullhearted giving.'),
(767, 49, '_section4_text7', 'field_5cb08fd6ad993'),
(768, 49, 'section4_text8', 'Everyone deserves a relaxing, stress-free retirement. Remove financial strain from your retirement years with precise planning from LifeLens.'),
(769, 49, '_section4_text8', 'field_5cb08fe5ad994'),
