(890, 151, 'section4_text1', 'This easy-to-use tool helps estate planners empower their clients with meticulous financial insight for the rest of their lives and beyond.'),
(891, 151, '_section4_text1', 'field_5cb08f6ead98d'),
(892, 151, 'section4_text2', 'By revealing the financial implications of a variety of life choices and hypotheticals, LifeLens removes uncertainty for a college grad’s transition into the workforce.'),
(893, 151, '_section4_text2', 'field_5cb08f84ad98e'),
(894, 151, 'section4_text3', 'Equip yourself with a clear understanding of the financial pros and cons of homeownership and take the anxiety out of the homebuying process.'),
(895, 151, '_section4_text3', 'field_5cb08f96ad98f'),
(896, 151, 'section4_text4', 'Providing the singles or widows in your life with a LifeLens subscription gives them the gift of financial certainty and peace of mind.'),
(897, 151, '_section4_text4', 'field_5cb08fa2ad990'),
(898, 151, 'section4_text5', 'Ever-changing family finances can feel like a rollercoaster. LifeLens helps provide stability and confidence, no matter how your family grows over the years.'),
(899, 151, '_section4_text5', 'field_5cb08fb1ad991'),
(900, 151, 'section4_text6', 'Newlyweds can start their marriage off on the right foot—and the same page—by sharing a complete understanding of their financial outlook.'),
(901, 151, '_section4_text6', 'field_5cb08fc7ad992'),
(902, 151, 'section4_text7', 'The advanced modeling and planning capabilities offered by LifeLens helps you live a life of comfortable, fullhearted giving.'),
(903, 151, '_section4_text7', 'field_5cb08fd6ad993'),
(904, 151, 'section4_text8', 'Everyone deserves a relaxing, stress-free retirement. Remove financial strain from your retirement years with precise planning from LifeLens.'),
(905, 151, '_section4_text8', 'field_5cb08fe5ad994'),
