(949, 49, 'section5_carousel_text1', '<p>As your life continues to evolve, LifeLens is your go-to <br />evergreen resource to forecast your options and understand the impact of changing circumstances and choices.</p>'),
(950, 49, 'section5_carousel_text1', '<p>As your life continues to evolve, LifeLens is your go-to <br />evergreen resource to forecast your options and understand the impact of changing circumstances and choices.</p>'),
(951, 49, '_section5_carousel_text1', 'field_5cb4782f6c7e7'),
(952, 49, '_section5_carousel_text1', 'field_5cb4782f6c7e7'),
(953, 49, 'section5_carousel_text2', '<p>When you have the power of long-term financial planning at your fingertips, all of life’s biggest, worthiest expenditures are a piece of cake.</p>'),
(954, 49, 'section5_carousel_text2', '<p>When you have the power of long-term financial planning at your fingertips, all of life’s biggest, worthiest expenditures are a piece of cake.</p>'),
(955, 49, '_section5_carousel_text2', 'field_5cb478736c7e8'),
(956, 49, '_section5_carousel_text2', 'field_5cb478736c7e8'),
(957, 49, 'section5_carousel_text3', '<p>The more financial clarity you achieve, the more you can contribute—with confidence—to the charities that mean the most to you and your family.</p>'),
(958, 49, 'section5_carousel_text3', '<p>The more financial clarity you achieve, the more you can contribute—with confidence—to the charities that mean the most to you and your family.</p>'),
(959, 49, '_section5_carousel_text3', 'field_5cb478836c7e9'),
(960, 49, '_section5_carousel_text3', 'field_5cb478836c7e9'),
(961, 49, 'section5_carousel_text4', '<p>With a deep and detailed financial understanding, you can give them the education of a lifetime without breaking a sweat (or the bank).</p>'),
(962, 49, 'section5_carousel_text4', '<p>With a deep and detailed financial understanding, you can give them the education of a lifetime without breaking a sweat (or the bank).</p>'),
(963, 49, '_section5_carousel_text4', 'field_5cb478946c7ea'),
(964, 49, '_section5_carousel_text4', 'field_5cb478946c7ea'),
(965, 49, 'section5_carousel_text5', '<p>Full financial clarity means you can look forward to—not run away from—homebuying and all of life’s biggest purchasing decisions.</p>'),
(966, 49, 'section5_carousel_text5', '<p>Full financial clarity means you can look forward to—not run away from—homebuying and all of life’s biggest purchasing decisions.</p>'),
(967, 49, '_section5_carousel_text5', 'field_5cb478b66c7eb'),
(968, 49, '_section5_carousel_text5', 'field_5cb478b66c7eb'),
(969, 49, 'section5_carousel_text6', '<p>By understanding your net worth across every year of the rest of <br />your life, LifeLens shows you exactly when you can retire with comfort <br />and peace of mind.</p>'),
(970, 49, 'section5_carousel_text6', '<p>By understanding your net worth across every year of the rest of <br />your life, LifeLens shows you exactly when you can retire with comfort <br />and peace of mind.</p>'),
(971, 49, '_section5_carousel_text6', 'field_5cb478c46c7ec'),
(972, 49, '_section5_carousel_text6', 'field_5cb478c46c7ec'),
(973, 49, 'section5_carousel_text7', '<p>The modeling capabilities of LifeLens let you challenge your financial outlook with hypothetical stress tests including market crashes, unforeseen medical expenses, and more.</p>'),
