(3866, 250, 'section5_carousel_text2', '<p>When you have the power of long-term financial planning at your fingertips, all of life’s biggest, worthiest expenditures are a piece of cake.</p>'),
(3867, 250, '_section5_carousel_text2', 'field_5cb478736c7e8'),
(3868, 250, 'section5_carousel_text3', '<p>The more financial clarity you achieve, the more you can contribute—with confidence—to the charities that mean the most to you and your family.</p>'),
