(5016, 250, 'section5_carousel_text5', '<p>Full financial clarity means you can look forward to—not run away from—homebuying and all of life’s biggest purchasing decisions.</p>'),
(5017, 250, '_section5_carousel_text5', 'field_5cb478b66c7eb'),
(5018, 250, 'section5_carousel_text6', '<p>By understanding your net worth across every year of the rest of <br />your life, LifeLens shows you exactly when you can retire with comfort <br />and peace of mind.</p>'),
(5019, 250, '_section5_carousel_text6', 'field_5cb478c46c7ec'),
(5020, 250, 'section5_carousel_text7', '<p>The modeling capabilities of LifeLens let you challenge your financial outlook with hypothetical stress tests including market crashes, unforeseen medical expenses, and more.</p>'),
