(5037, 250, '_section7_title', 'field_5cb489edf76b9'),
(5038, 250, 'section7_text', '<p>Knowing your net worth—both where it is now and where it’s trending—is crucial to gaining true financial confidence. Use the free LifeLens Net Worth Calculator to understand what you’re worth now and across your lifetime.</p>'),
(5039, 250, '_section7_text', 'field_5cb48a0ef76ba'),
