(5047, 250, '_section8_title', 'field_5cb4a07029363'),
(5048, 250, 'section8_text', '<p>Financial planning can feel daunting, but we’re here for you every step of the way. If you feel stuck or uncertain at any point, get in touch using chat assistance, <a href=\"http://www.4g.ck.ua\">consult</a> with a LifeLens financial expert, or take a look at our library of video tutorials.</p>'),
(5049, 250, '_section8_text', 'field_5cb4a08e29364'),
