(5402, 49, '_section6_text2_1', 'field_5cbdc7356b62d'),
(5403, 49, 'section6_text2_4', 'With clear and powerful modeling capabilities, you can answer all\r\n of life’s big “what if” questions with clear-eyed confidence. You’ll\r\n understand exactly how your finances would hypothetically fare\r\n           with every big life choice or potential catastrophe.'),
(5404, 49, '_section6_text2_4', 'field_5cbdca8738595'),
(5405, 49, 'section6_text2_3', 'Using tens of thousands of calculations, LifeLens will provide you\r\n with a detailed projection of your complete, year-by-year financial\r\n                          picture for the rest of your life.'),
