(5713, 393, 'aboutus_section1_text', '<p>For more than 30 years, the LifeLens financial forecasting tool has provided individuals and families with detailed, year-by-year financial projections to empower more confident financial decision-making. Unlike many financial forecasting tool providers, the LifeLens modeling experts are not interested in managing your money. Their primary focus is providing the best financial modeling tool available, enhanced and updated continuously and built on decades of fine-tuning, so you can make the best financial choices for your circumstances—every year for the rest of your life.</p>'),
